import styled from "styled-components";
import { Icon, Heading } from "../components";

const user = {
  primary: "Ryan Breaux",
  enrolled: [
    { name: "Dani Breaux", sport: "soccer" },
    { name: "Zeke Breaux", sport: "soccer" },
  ],
};

const User_Overview = ({ enrolled = [] }) => {
  return (
    <div className="Dash_Overview">
      <span>
        <Heading>Ryan Breaux</Heading>
        <Icon type="soccer" />
      </span>
      <span>
        {enrolled.map(({ sport, name }) => (
          <>
            <Heading>{name}</Heading>
            <Icon type={sport} />
          </>
        ))}
      </span>
    </div>
  );
};

export default User_Overview;
